import { Navigate } from 'react-router';
import './Home.css';
import logo from './img/cow.png';
import { useNavigate } from 'react-router-dom';


function Home() {
    const navigate = useNavigate();
    const clickGetStarted=()=>{
        navigate('/map');
    }

    return(
        <>
            <nav class="navbar">
                <a href="#" class="logo-container">       
                <img className="cow" src={logo} alt="logo"/>
                    <span class="logo-text">AlienExpress</span>
                </a>
                <div class="nav-links">
                    <a href="index.html">Desktop App</a>
                    <a href="Map.js">Place Selection</a>
                    <a href="listing.html">Resource Shop</a>
                </div>
            </nav>

        <div class="titleing">
            <div class="glow"></div>
            <h1 class="floating">Intergalactic Resource Marketplace</h1>
            <h2 class="floating">for underpriviledged communities in need</h2>
            <a href="Map.js" class="startbutton pulse" onClick={clickGetStarted}>
                Get Started
            </a>
        </div>
        <div class="features">

        <div class="feature-card">
            <img src="https://cdn.glitch.global/6cecf6a3-d527-4bf1-b4c3-e4900e777fdb/Screenshot%202024-11-16%20145647.png" alt="Mapping" className='mapping' />
            <h3>Agriculture Potential</h3>
            <p>Mapping to get soil moisture, weather, and everything else needed to farm</p>
        </div>

        <div class="feature-card">
            <img src="https://cdn.glitch.global/6cecf6a3-d527-4bf1-b4c3-e4900e777fdb/OIP.jpg" alt="Resources" className='resources' />
            <h3>Resource Trade</h3>
            <p>Trading natural resources from other planets for cows on earth</p>
        </div>
    </div>
        </>
    );
}

export default Home;
